function Input({
  id,
  label,
  onChange,
  type = 'text',
  required = false
}) {
  return (
    <>
      <label htmlFor={id}>{label}</label>
      <input
        type={type}
        id={id}
        name={id}
        onChange={onChange}
        required={required}
      />
    </>
  )
}

export default Input
